import React from "react";
import { BrowserRouter as
  Switch,
  Route,
  Router
} from "react-router-dom";
import Home from "./Home";

function App() {
  return (
    <Router>
      <Switch>
      <Route path="/" component={Home} />
      </Switch>
    </Router>
  );
}

export default App;
